import React from 'react'
import './FaceRecognition.css'
const FaceRecognition=({imageUrl,Box})=>{
	console.log(Box);
	const styleObj={
		top:Box.topRow,
		right:Box.rightCol,
		bottom:Box.bottomRow,
		left:Box.leftCol
	}
	return(
		<div className='center'>
			<div className='absolute mt2'>
				<img id='inputImage' alt="image" class='center' src={imageUrl} />
				<div className="bounding-box" style={styleObj}></div>
			</div>
		</div>
	);
}

export default FaceRecognition;
